import React from 'react';
import { Card } from 'react-bootstrap';

function BlogPost() {
  return (
    <Card className="mb-4">
      <Card.Header>
        <h2 className="card-title">Sample Blog Post</h2>
        <p className="card-subtitle text-muted">January 1, 2024 by <a href="#">Mark</a></p>
      </Card.Header>
      <Card.Body>
        <p className="card-text">
          This is some sample content for the blog post. It can include paragraphs, images, links, and more.
        </p>
      </Card.Body>
    </Card>
  );
}

export default BlogPost;
